  true,\n\t\"url\": null,\n\t\"notes\": \"Objective of the Current Industrial Reports
  (CIR) program is to produce timely, accurate data on production and shipments of
  selected products. The data are used to satisfy economic policy needs and for market
  analysis, forecasting, and decision-making in the private sector. Individual firms,
  trade associations, and market analysts in planning or recommending marketing and
  legislative strategies use the product-level data generated by these surveys extensively,
  particularly if their industry is significantly affected by foreign trade.\",\n\t\"license_title\":
